  def symmetric_array?(items)
    head, tail = 0, items.size - 1

    until head >= tail
      return false if items[head] != items[tail]

      head += 1
      tail -= 1
    end
    true
  end

  def leaf?(node)
    return true if node.nil?
    node.left.nil? && node.right.nil?
  end

  def symmetric?(tree)
		queue = [node: tree, level: 0]
		items = Hash.new { |h, k| h[k] = [] }

    until queue.empty?
      item = queue.shift
      node = item[:node]
      items[item[:level]].push(node&.value)

      unless leaf?(node)
        queue.push(node: node&.left, level: item[:level] + 1)
        queue.push(node: node&.right, level: item[:level] + 1)
      end
    end
		items.each do |key, value|
			return false unless symmetric_array?(value)
		end
    true
  end

